汗によって失われる成分に近いイオン組成を再現。<br>身体から失われた「水分」と「塩分」を簡単に補給できる飲料水です。<br>さらに「L-カルニチン」「ナイアシン」「クエン酸」配合で夏の体をしっかりサポートしてくれます。<br>カロリーゼロだからダイエット中でも毎日安心してお飲みいただけます。<br>「熱中対策水」であつい夏を乗り切りましょう。<br>【原材料】<br>海水(海洋深層水)、塩、L-カルニチン、L-酒石酸塩：酸味料、硫酸マグネシウム、香料、塩化K、甘味料(スクラロース、アセスルファムK)、ナイアシン<br>【栄養成分(500mlあたり)】<br>熱量、たんぱく質、脂質・炭水化物：0、食塩相当量：0.83g、マグネシウム：70mg、カルシウム：10mg<br>カリウム：100mg、ナイアシン：6.5mg、ビタミン（パントテン酸・A・B1・B2・B6・B12・C・D・E・K・葉酸)：0、クエン酸：1500mg、Lカルニチン：50mg<br><br><br>■商品詳細<br><table width=630 border=1 cellspacing=0><tr><td bgcolor=#ffffcc><p style=margin:10px;>メーカー名：赤穂化成株式会社<br>内容量：500ml×24本<br><br>購入単位：1箱(24本)<br>配送種別：在庫品</p></td></tr></table><br><br><table width=600 border=0 cellspacing=0><tr><td><font size=1>【検索用キーワード】<br>4901291990758 S04696 s04696 DS0451 ds0451 赤穂化成株式会社 あこうかせいかぶしきがいしゃ かぶしきがいしゃあかほかせい あこうかせい 熱中症対策 ねっちゅうしょうたいさく 熱中対策 ねっちゅうたいさく 熱中症 ねっちゅうショウ スポーツ すぽーつ 外出 がいしゅつ 食品 飲料 いんりょう 熱中 ドリンク どりんく 飲み物 のみもの レモン味 レモン れもん 500ml 24本入り 24本 熱中症対策水 ねっちゅうしょうたいさくすい ペットボトル ぺっとぼとる ジュース じゅーす ソフトドリンク そふとどりんく</font></td></tr></table><style type="text/css">
